import React from 'react';

import {Image, StyleSheet, View} from 'react-native';

import Texto from '../../../componentes/texto'

import logo from '../../../../assets/logo.png';

import labels from '../../../mocks/cesta'

export default function ItemDetail(){

    return <><Texto style={style.nome}>{labels.detalhes.nome}</Texto>
    <View style={style.fazenda}>
        <Image source={logo} style={style.logo}></Image>
        <Texto style={style.nomeFazenda}>labels.detalhes.nomeFazenda</Texto>
    </View>

    <Texto style={style.descricao}>labels.detalhes.descricao</Texto>
    <Texto style={style.preco}>labels.detalhes.preco</Texto></>

}

const style = StyleSheet.create({

    nome:{
        fontSize:26,
        lineHeight: 42,
        color: "#464646",
        fontWeight: "bold",

    },
    fazenda:{
        flexDirection:"row",
        paddingVertical:12
    },
    logo:{
        width: 32,
        height:32
    },
    nomeFazenda:{
        fontSize:16,
        lineHeight:26,
        marginLeft:12,
        fontFamily:"MontserratRegular"
    },
    descricao:{
        color:"#A3A3A3",
        fontSize:16,
        lineHeight:26
    },
    preco:{
        color:"#2A9F85",
        fontWeight:"bold",
        fontSize:26,
        lineHeight:42,
        margimTop:8
    },

})
